import TradeItem from "./components/TradeItem";

function Trades(props) {

    return(
        <div className="trades">
            <TradeItem
                date={trades[0].date}
                name={trades[0].name}
                ticker={trades[0].ticker}
                pnl={trades[0].pnl} 
            />
            <TradeItem
                date={trades[1].date}
                name={trades[1].name}
                ticker={trades[1].ticker}
                pnl={trades[1].pnl} 
            />
            <TradeItem
                date={trades[2].date}
                name={trades[2].name}
                ticker={trades[2].ticker}
                pnl={trades[2].pnl} 
            />
        </div>
    )

}

export default Trades
